var CHAR_HEIGHT = 42;
var CHAR_WIDTH = 24;
var LINE_SPACING = 1.2;

var glyphs = "\\u01234567(8bcef9ad!\"#$%&')+,-./:;>?@ABCDEFGH<IJKLMNOPQRSTU*VW=XY[Z]^_`ghijklmnopqr|stvwx}yz{~";

module.exports = function(image, color, text, size, x, y, boxWidth, boxHeight, bgColor) {
    boxWidth = boxWidth || Infinity;
    boxHeight = boxHeight || Infinity;
    bgColor = bgColor || [256,256,256];

    var scaledFont = [];
    var charHeight = CHAR_HEIGHT;
    var charWidth = CHAR_WIDTH;
    if(size != 30 || true) {
        var scaleFactor = size / 30;
        console.log("sf", scaleFactor);
        
        for(var k = 0; k < font.length; k++) {
            var glyph = font[k];
            var width = Math.floor(glyph[0].length * scaleFactor);
            var height = Math.floor(glyph.length * scaleFactor);

            var scaledPixels = [];

            for(var i = 0; i < height; i++) {
                var row = [];
                for(var j = 0; j < width; j++) {
                    var sample = slice2d(glyph, Math.floor(j / scaleFactor), Math.floor(i / scaleFactor), Math.ceil(1 / scaleFactor), Math.ceil(1 / scaleFactor) );
                    var pxl = average(sample);
                    row.push(pxl);
                }
                scaledPixels.push(row);
            }
            scaledFont.push(scaledPixels);
        }
        charWidth = CHAR_WIDTH * scaleFactor;
        charHeight = CHAR_HEIGHT * scaleFactor;
    }
    

    var pointX = x, pointY = y;
    for(var i = 0; i < text.length; i++) {
        var glyphIndex = glyphs.indexOf(text[i]);
        if(glyphIndex == -1) {
            if(text[i] == "\n" || text[i] == "\r") {
                pointY += charHeight * LINE_SPACING;
                pointX = x - CHAR_WIDTH;
                if(text[i] == "\r" && text[i + 1] == "\n") i++;
            }
            
        } else {
            var letter = scaledFont[glyphIndex];
            for(var j = 0; j < letter.length; j++) {
                for(var k = 0; k < letter[0].length; k++) {
                    if(pointY < boxHeight && pointX < boxWidth) {
                        image[Math.floor(pointY) + j][Math.floor(pointX) + k] = interpolate(image[Math.floor(pointY) + j][Math.floor(pointX) + k], color, letter[j][k]);
                    }
                }
            }
        }
        pointX += charWidth;
    }
}


function slice2d(pixels, x, y, width, height) {
    x = Math.floor(x), y = Math.floor(y);
    var rows = [];
    for(var i = y; i < y + height; i++) {
        rows.push(pixels[i].slice(x, x + width));
    }
    return rows;
}

function average(pixels) {
    var total = 0;
    for(var i = 0; i < pixels.length; i++) {
        for(var j = 0; j < pixels[i].length; j++) {
            total += pixels[i][j];
        }
    }
    var pixelCount = pixels.length * pixels[0].length;
    return total / pixelCount;
}

function interpolate(start, end, time) {
    return [
        start[0] + time * (end[0] - start[0]),
        start[1] + time * (end[1] - start[1]),
        start[2] + time * (end[2] - start[2])
    ];
}